// SPDX-License-Identifier: MIT
pragma solidity 0.8.24;

import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";
import "./interfaces/ICertificateRegistry.sol";
import "./interfaces/IInstitutionRegistry.sol";

/**
 * @title CertificateRegistry
 * @notice Manages educational certificates on zkSync Era
 * @dev Implements UUPS upgradeable pattern with role-based access control
 * 
 * Features:
 * - Issue certificates with SHA-256 document hash
 * - Revoke certificates with reason
 * - Query certificates by ID, hash, or student
 * - Verify certificate validity
 * 
 * Security:
 * - Only verified and active institutions can issue certificates
 * - Only issuing institution or super admin can revoke
 * - Reentrancy protection on state-changing functions
 * - Duplicate hash prevention
 */
contract CertificateRegistry is
    Initializable,
    AccessControlUpgradeable,
    UUPSUpgradeable,
    ReentrancyGuardUpgradeable,
    ICertificateRegistry
{
    /// @notice Contract version for tracking upgrades
    string public constant VERSION = "1.0.0";

    /// @notice Role identifier for super admin
    bytes32 public constant SUPER_ADMIN_ROLE = keccak256("SUPER_ADMIN_ROLE");

    /// @notice Struct to track contract upgrades
    struct UpgradeInfo {
        string version;
        uint256 timestamp;
        address upgrader;
        string notes;
    }

    /// @notice Reference to the InstitutionRegistry contract
    IInstitutionRegistry public institutionRegistry;

    /// @notice Mapping from certificate ID to certificate data
    mapping(uint256 => Certificate) public certificates;

    /// @notice Mapping from student wallet to their certificate IDs
    mapping(address => uint256[]) public studentCertificates;

    /// @notice Mapping from document hash to certificate ID
    mapping(bytes32 => uint256) public hashToCertificateId;

    /// @notice Counter for generating unique certificate IDs
    uint256 internal _certificateIdCounter;

    /// @notice Array tracking all contract upgrades
    UpgradeInfo[] public upgradeHistory;

    // Custom Errors
    error UnauthorizedIssuer();
    error CertificateAlreadyExists();
    error CertificateNotFound();
    error CertificateAlreadyRevoked();
    error NotCertificateIssuer();
    error InvalidStudentAddress();
    error InvalidDocumentHash();
    error InvalidAddress();

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    /**
     * @notice Initialize the contract
     * @param superAdmin Address of the super admin
     * @param _institutionRegistry Address of the InstitutionRegistry contract
     */
    function initialize(
        address superAdmin,
        address _institutionRegistry
    ) public initializer {
        if (superAdmin == address(0)) revert InvalidAddress();
        if (_institutionRegistry == address(0)) revert InvalidAddress();

        __AccessControl_init();
        __UUPSUpgradeable_init();
        __ReentrancyGuard_init();

        _grantRole(DEFAULT_ADMIN_ROLE, superAdmin);
        _grantRole(SUPER_ADMIN_ROLE, superAdmin);

        institutionRegistry = IInstitutionRegistry(_institutionRegistry);
        _certificateIdCounter = 1; // Start from 1 so 0 means "not found"

        // Record initial version
        upgradeHistory.push(UpgradeInfo({
            version: VERSION,
            timestamp: block.timestamp,
            upgrader: msg.sender,
            notes: "Initial deployment"
        }));
    }

    /**
     * @notice Issue a new certificate
     * @param documentHash SHA-256 hash of the PDF document
     * @param studentWallet Wallet address of the student receiving the certificate
     * @param metadataURI Optional IPFS/Arweave URI for additional metadata
     * @return certificateId The unique ID of the issued certificate
     * @dev Only callable by verified and active institutions
     */
    function issueCertificate(
        bytes32 documentHash,
        address studentWallet,
        string calldata metadataURI
    ) external nonReentrant returns (uint256) {
        // Validate inputs
        if (studentWallet == address(0)) revert InvalidStudentAddress();
        if (documentHash == bytes32(0)) revert InvalidDocumentHash();

        // Check institution authorization
        if (!institutionRegistry.canIssueCertificates(msg.sender))
            revert UnauthorizedIssuer();

        // Check for duplicate hash
        if (hashToCertificateId[documentHash] != 0)
            revert CertificateAlreadyExists();

        // Generate unique certificate ID
        uint256 certificateId = _certificateIdCounter++;

        // Store certificate
        certificates[certificateId] = Certificate({
            documentHash: documentHash,
            studentWallet: studentWallet,
            issuingInstitution: msg.sender,
            issueDate: block.timestamp,
            certificateId: certificateId,
            metadataURI: metadataURI,
            isRevoked: false,
            revokedAt: 0,
            revocationReason: ""
        });

        // Update mappings
        studentCertificates[studentWallet].push(certificateId);
        hashToCertificateId[documentHash] = certificateId;

        // Update institution stats
        institutionRegistry.incrementCertificateCount(msg.sender);

        emit CertificateIssued(
            certificateId,
            documentHash,
            studentWallet,
            msg.sender,
            block.timestamp
        );

        return certificateId;
    }

    /**
     * @notice Revoke a certificate
     * @param certificateId The ID of the certificate to revoke
     * @param reason The reason for revocation
     * @dev Only callable by the issuing institution or super admin
     */
    function revokeCertificate(
        uint256 certificateId,
        string calldata reason
    ) external nonReentrant {
        Certificate storage cert = certificates[certificateId];

        // Validate certificate exists
        if (cert.certificateId == 0) revert CertificateNotFound();

        // Check if already revoked
        if (cert.isRevoked) revert CertificateAlreadyRevoked();

        // Check authorization (issuer or super admin)
        if (
            cert.issuingInstitution != msg.sender &&
            !hasRole(SUPER_ADMIN_ROLE, msg.sender)
        ) revert NotCertificateIssuer();

        // Revoke certificate
        cert.isRevoked = true;
        cert.revokedAt = block.timestamp;
        cert.revocationReason = reason;

        emit CertificateRevoked(
            certificateId,
            msg.sender,
            reason,
            block.timestamp
        );
    }

    /**
     * @notice Get certificate by ID
     * @param certificateId The ID of the certificate
     * @return Certificate struct with all details
     */
    function getCertificate(
        uint256 certificateId
    ) external view returns (Certificate memory) {
        if (certificates[certificateId].certificateId == 0)
            revert CertificateNotFound();
        return certificates[certificateId];
    }

    /**
     * @notice Get certificate by document hash
     * @param documentHash The SHA-256 hash of the document
     * @return Certificate struct with all details
     */
    function getCertificateByHash(
        bytes32 documentHash
    ) external view returns (Certificate memory) {
        uint256 certId = hashToCertificateId[documentHash];
        if (certId == 0) revert CertificateNotFound();
        return certificates[certId];
    }

    /**
     * @notice Get all certificate IDs for a student
     * @param studentWallet The wallet address of the student
     * @return Array of certificate IDs
     */
    function getCertificatesByStudent(
        address studentWallet
    ) external view returns (uint256[] memory) {
        return studentCertificates[studentWallet];
    }

    /**
     * @notice Verify if a certificate is valid
     * @param documentHash The SHA-256 hash of the document
     * @return isValid True if the certificate exists and is not revoked
     * @return certificateId The ID of the certificate (0 if not found)
     * @return isRevoked True if the certificate has been revoked
     */
    function isValidCertificate(
        bytes32 documentHash
    ) external view returns (bool isValid, uint256 certificateId, bool isRevoked) {
        certificateId = hashToCertificateId[documentHash];

        // Not found
        if (certificateId == 0) {
            return (false, 0, false);
        }

        Certificate storage cert = certificates[certificateId];
        isRevoked = cert.isRevoked;
        isValid = !isRevoked;

        return (isValid, certificateId, isRevoked);
    }

    /**
     * @notice Get total number of certificates issued
     * @return The total count (counter - 1 since we start from 1)
     */
    function getTotalCertificates() external view returns (uint256) {
        return _certificateIdCounter - 1;
    }

    /**
     * @notice Get certificates issued by a specific institution
     * @param institution The wallet address of the institution
     * @param offset Starting index for pagination
     * @param limit Maximum number of results to return
     * @return certificateIds Array of certificate IDs
     * @return total Total number of certificates for this institution
     * @dev Iterates through all certificates (gas intensive for large datasets)
     *      Consider using The Graph for efficient queries in production
     */
    function getCertificatesByInstitution(
        address institution,
        uint256 offset,
        uint256 limit
    ) external view returns (uint256[] memory certificateIds, uint256 total) {
        // First pass: count total
        uint256 count = 0;
        for (uint256 i = 1; i < _certificateIdCounter; i++) {
            if (certificates[i].issuingInstitution == institution) {
                count++;
            }
        }

        total = count;

        // Handle pagination
        if (offset >= count) {
            return (new uint256[](0), total);
        }

        uint256 resultCount = limit;
        if (offset + limit > count) {
            resultCount = count - offset;
        }

        certificateIds = new uint256[](resultCount);

        // Second pass: collect results
        uint256 found = 0;
        uint256 added = 0;
        for (uint256 i = 1; i < _certificateIdCounter && added < resultCount; i++) {
            if (certificates[i].issuingInstitution == institution) {
                if (found >= offset) {
                    certificateIds[added] = i;
                    added++;
                }
                found++;
            }
        }

        return (certificateIds, total);
    }

    /**
     * @notice Get current contract version
     * @return Current version string
     */
    function getVersion() public pure virtual returns (string memory) {
        return VERSION;
    }

    /**
     * @notice Get complete upgrade history
     * @return Array of all UpgradeInfo structs
     */
    function getUpgradeHistory() external view returns (UpgradeInfo[] memory) {
        return upgradeHistory;
    }

    /**
     * @notice Record a contract upgrade
     * @param newVersion Version string for the upgrade (e.g., "2.0.0")
     * @param notes Description of changes in this upgrade
     * @dev Only callable by super admin. Should be called after upgrading the contract.
     */
    function recordUpgrade(
        string calldata newVersion,
        string calldata notes
    ) external onlyRole(SUPER_ADMIN_ROLE) {
        upgradeHistory.push(UpgradeInfo({
            version: newVersion,
            timestamp: block.timestamp,
            upgrader: msg.sender,
            notes: notes
        }));
    }

    /**
     * @dev Storage gap for future upgrades
     * Reserves 47 slots for adding new state variables without breaking storage layout
     * If adding new variables, reduce this number accordingly (50 - added slots)
     */
    uint256[47] private __gap;

    /**
     * @notice Update the institution registry address
     * @param _institutionRegistry New InstitutionRegistry address
     * @dev Only callable by super admin
     */
    function setInstitutionRegistry(
        address _institutionRegistry
    ) external onlyRole(SUPER_ADMIN_ROLE) {
        if (_institutionRegistry == address(0)) revert InvalidAddress();
        institutionRegistry = IInstitutionRegistry(_institutionRegistry);
    }

    /**
     * @notice Authorize contract upgrade
     * @param newImplementation Address of the new implementation
     * @dev Only callable by super admin
     */
    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyRole(SUPER_ADMIN_ROLE) {}
}

contracts/CertificateRegistryV2.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.24;

import "./CertificateRegistry.sol";

/**
 * @title CertificateRegistryV2
 * @notice Version 2.0.0 of the CertificateRegistry contract
 * @dev Example upgrade contract demonstrating:
 *      - Version update
 *      - New features (batch operations)
 *      - Storage layout preservation
 *      - Upgrade recording
 * 
 * IMPORTANT: This is a template/example. Actual V2 features should be implemented
 *           based on real requirements from Phase 2 of the roadmap.
 */
contract CertificateRegistryV2 is CertificateRegistry {
    /// @notice Updated version for V2
    string public constant VERSION_V2 = "2.0.0";

    /**
     * @dev New storage variables MUST be added at the end
     * Never reorder or delete existing variables from parent contract
     */

    /// @notice New feature: Track batch operations
    mapping(bytes32 => bool) public batchOperations;

    /// @notice New feature: Certificate templates
    mapping(uint256 => string) public certificateTemplates;
    uint256 public templateCounter;

    // Events for new features
    event BatchOperationRecorded(bytes32 indexed batchId, uint256 certificateCount);
    event TemplateCreated(uint256 indexed templateId, string templateName);

    /**
     * @notice Initialize V2 upgrade
     * @param notes Description of changes in this upgrade
     * @dev Use reinitializer(2) for V2, reinitializer(3) for V3, etc.
     *      This function should be called immediately after upgrade
     */
    function upgradeToV2(string calldata notes) external reinitializer(2) {
        // Record the upgrade
        upgradeHistory.push(UpgradeInfo({
            version: VERSION_V2,
            timestamp: block.timestamp,
            upgrader: msg.sender,
            notes: notes
        }));

        // Initialize new V2 state variables if needed
        templateCounter = 1;
    }

    /**
     * @notice Get current version (override to return V2 version)
     * @return Current version string
     */
    function getVersion() public pure override returns (string memory) {
        return VERSION_V2;
    }

    /**
     * @notice Issue multiple certificates in a single transaction
     * @param documentHashes Array of SHA-256 hashes
     * @param studentWallets Array of student wallet addresses
     * @param metadataURIs Array of metadata URIs
     * @return batchId Unique identifier for this batch operation
     * @return certificateIds Array of generated certificate IDs
     * @dev New feature in V2. Requires arrays to be same length.
     */
    function issueCertificateBatch(
        bytes32[] calldata documentHashes,
        address[] calldata studentWallets,
        string[] calldata metadataURIs
    ) external nonReentrant returns (bytes32 batchId, uint256[] memory certificateIds) {
        // Validate inputs
        require(
            documentHashes.length == studentWallets.length &&
            documentHashes.length == metadataURIs.length,
            "Array length mismatch"
        );
        require(documentHashes.length > 0, "Empty batch");
        require(documentHashes.length <= 100, "Batch too large");

        // Check authorization
        if (!institutionRegistry.canIssueCertificates(msg.sender))
            revert UnauthorizedIssuer();

        // Generate batch ID
        batchId = keccak256(abi.encodePacked(
            msg.sender,
            block.timestamp,
            documentHashes.length
        ));

        // Issue certificates
        certificateIds = new uint256[](documentHashes.length);
        for (uint256 i = 0; i < documentHashes.length; i++) {
            // Validate individual certificate
            if (studentWallets[i] == address(0)) revert InvalidStudentAddress();
            if (documentHashes[i] == bytes32(0)) revert InvalidDocumentHash();
            if (hashToCertificateId[documentHashes[i]] != 0)
                revert CertificateAlreadyExists();

            // Issue certificate using internal logic
            uint256 certificateId = _certificateIdCounter++;

            certificates[certificateId] = Certificate({
                documentHash: documentHashes[i],
                studentWallet: studentWallets[i],
                issuingInstitution: msg.sender,
                issueDate: block.timestamp,
                certificateId: certificateId,
                metadataURI: metadataURIs[i],
                isRevoked: false,
                revokedAt: 0,
                revocationReason: ""
            });

            studentCertificates[studentWallets[i]].push(certificateId);
            hashToCertificateId[documentHashes[i]] = certificateId;
            certificateIds[i] = certificateId;

            emit CertificateIssued(
                certificateId,
                documentHashes[i],
                studentWallets[i],
                msg.sender,
                block.timestamp
            );
        }

        // Update institution stats
        for (uint256 i = 0; i < documentHashes.length; i++) {
            institutionRegistry.incrementCertificateCount(msg.sender);
        }

        // Record batch operation
        batchOperations[batchId] = true;
        emit BatchOperationRecorded(batchId, documentHashes.length);

        return (batchId, certificateIds);
    }

    /**
     * @notice Create a certificate template
     * @param templateName Name/description of the template
     * @return templateId The ID of the created template
     * @dev New feature in V2
     */
    function createTemplate(
        string calldata templateName
    ) external onlyRole(SUPER_ADMIN_ROLE) returns (uint256) {
        uint256 templateId = templateCounter++;
        certificateTemplates[templateId] = templateName;

        emit TemplateCreated(templateId, templateName);

        return templateId;
    }

    /**
     * @notice Check if a batch operation was recorded
     * @param batchId The batch identifier
     * @return True if the batch was recorded
     */
    function isBatchRecorded(bytes32 batchId) external view returns (bool) {
        return batchOperations[batchId];
    }

    /**
     * @notice Get template name by ID
     * @param templateId The template identifier
     * @return The template name
     */
    function getTemplate(uint256 templateId) external view returns (string memory) {
        return certificateTemplates[templateId];
    }

    /**
     * @dev Reduced storage gap to account for new variables
     * Original: uint256[47] (from V1)
     * New variables added: batchOperations (1 slot), certificateTemplates (1 slot), templateCounter (1 slot)
     * Adjusted gap: 47 - 3 = 44 slots remaining
     */
    uint256[44] private __gapV2;
}

contracts/InstitutionRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.24;

import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";
import "./interfaces/IInstitutionRegistry.sol";

/**
 * @title InstitutionRegistry
 * @notice Manages educational institutions that can issue certificates
 * @dev Implements UUPS upgradeable pattern with role-based access control
 * 
 * Roles:
 * - SUPER_ADMIN_ROLE: Can approve/suspend/reactivate institutions and upgrade contract
 * - DEFAULT_ADMIN_ROLE: Can manage other roles
 * 
 * Flow:
 * 1. Institution calls registerInstitution() with their details
 * 2. Super admin calls approveInstitution() to verify the institution
 * 3. Once approved, institution can issue certificates via CertificateRegistry
 */
contract InstitutionRegistry is
    Initializable,
    AccessControlUpgradeable,
    UUPSUpgradeable,
    ReentrancyGuardUpgradeable,
    IInstitutionRegistry
{
    /// @notice Contract version for tracking upgrades
    string public constant VERSION = "1.0.0";

    /// @notice Role identifier for super admin
    bytes32 public constant SUPER_ADMIN_ROLE = keccak256("SUPER_ADMIN_ROLE");

    /// @notice Role identifier for certificate registry contract
    bytes32 public constant CERTIFICATE_REGISTRY_ROLE = keccak256("CERTIFICATE_REGISTRY_ROLE");

    /// @notice Struct to track contract upgrades
    struct UpgradeInfo {
        string version;
        uint256 timestamp;
        address upgrader;
        string notes;
    }

    /// @notice Mapping from wallet address to institution data
    mapping(address => Institution) public institutions;

    /// @notice Array of all registered institution addresses
    address[] public institutionList;

    /// @notice Mapping from email domain to institution address (for uniqueness)
    mapping(string => address) public emailDomainToAddress;

    /// @notice Array tracking all contract upgrades
    UpgradeInfo[] public upgradeHistory;

    // Custom Errors
    error InstitutionAlreadyExists();
    error InstitutionNotFound();
    error InstitutionNotVerified();
    error InstitutionAlreadyVerified();
    error InstitutionNotActive();
    error InstitutionAlreadyActive();
    error EmailDomainAlreadyRegistered();
    error InvalidEmailDomain();
    error InvalidName();
    error InvalidAddress();

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    /**
     * @notice Initialize the contract
     * @param superAdmin Address of the super admin
     */
    function initialize(address superAdmin) public initializer {
        if (superAdmin == address(0)) revert InvalidAddress();

        __AccessControl_init();
        __UUPSUpgradeable_init();
        __ReentrancyGuard_init();

        _grantRole(DEFAULT_ADMIN_ROLE, superAdmin);
        _grantRole(SUPER_ADMIN_ROLE, superAdmin);

        // Record initial version
        upgradeHistory.push(UpgradeInfo({
            version: VERSION,
            timestamp: block.timestamp,
            upgrader: msg.sender,
            notes: "Initial deployment"
        }));
    }

    /**
     * @notice Register a new institution
     * @param name Official name of the institution
     * @param emailDomain Verified email domain (e.g., "mit.edu")
     * @dev Anyone can register, but must be approved by super admin to issue certificates
     */
    function registerInstitution(
        string calldata name,
        string calldata emailDomain
    ) external nonReentrant {
        if (bytes(name).length == 0) revert InvalidName();
        if (bytes(emailDomain).length == 0) revert InvalidEmailDomain();
        if (institutions[msg.sender].walletAddress != address(0))
            revert InstitutionAlreadyExists();
        if (emailDomainToAddress[emailDomain] != address(0))
            revert EmailDomainAlreadyRegistered();

        institutions[msg.sender] = Institution({
            name: name,
            emailDomain: emailDomain,
            walletAddress: msg.sender,
            isVerified: false,
            isActive: false,
            verificationDate: 0,
            totalCertificatesIssued: 0
        });

        institutionList.push(msg.sender);
        emailDomainToAddress[emailDomain] = msg.sender;

        emit InstitutionRegistered(msg.sender, name, emailDomain);
    }

    /**
     * @notice Approve a registered institution
     * @param wallet Address of the institution to approve
     * @dev Only callable by super admin
     */
    function approveInstitution(
        address wallet
    ) external onlyRole(SUPER_ADMIN_ROLE) {
        Institution storage inst = institutions[wallet];
        if (inst.walletAddress == address(0)) revert InstitutionNotFound();
        if (inst.isVerified) revert InstitutionAlreadyVerified();

        inst.isVerified = true;
        inst.isActive = true;
        inst.verificationDate = block.timestamp;

        emit InstitutionApproved(wallet, block.timestamp);
    }

    /**
     * @notice Suspend an active institution
     * @param wallet Address of the institution to suspend
     * @dev Only callable by super admin. Institution can be reactivated later.
     */
    function suspendInstitution(
        address wallet
    ) external onlyRole(SUPER_ADMIN_ROLE) {
        Institution storage inst = institutions[wallet];
        if (inst.walletAddress == address(0)) revert InstitutionNotFound();
        if (!inst.isActive) revert InstitutionNotActive();

        inst.isActive = false;

        emit InstitutionSuspended(wallet, block.timestamp);
    }

    /**
     * @notice Reactivate a suspended institution
     * @param wallet Address of the institution to reactivate
     * @dev Only callable by super admin. Institution must have been verified before.
     */
    function reactivateInstitution(
        address wallet
    ) external onlyRole(SUPER_ADMIN_ROLE) {
        Institution storage inst = institutions[wallet];
        if (inst.walletAddress == address(0)) revert InstitutionNotFound();
        if (!inst.isVerified) revert InstitutionNotVerified();
        if (inst.isActive) revert InstitutionAlreadyActive();

        inst.isActive = true;

        emit InstitutionReactivated(wallet, block.timestamp);
    }

    /**
     * @notice Check if an institution can issue certificates
     * @param wallet Address of the institution
     * @return True if the institution is verified and active
     */
    function canIssueCertificates(address wallet) external view returns (bool) {
        Institution storage inst = institutions[wallet];
        return inst.isVerified && inst.isActive;
    }

    /**
     * @notice Increment the certificate count for an institution
     * @param wallet Address of the institution
     * @dev Only callable by CertificateRegistry contract
     */
    function incrementCertificateCount(
        address wallet
    ) external onlyRole(CERTIFICATE_REGISTRY_ROLE) {
        institutions[wallet].totalCertificatesIssued++;
    }

    /**
     * @notice Get institution details
     * @param wallet Address of the institution
     * @return Institution struct with all details
     */
    function getInstitution(
        address wallet
    ) external view returns (Institution memory) {
        return institutions[wallet];
    }

    /**
     * @notice Get all registered institution addresses
     * @return Array of institution wallet addresses
     */
    function getAllInstitutions() external view returns (address[] memory) {
        return institutionList;
    }

    /**
     * @notice Get the total number of registered institutions
     * @return The count of institutions
     */
    function getInstitutionCount() external view returns (uint256) {
        return institutionList.length;
    }

    /**
     * @notice Get institution by email domain
     * @param emailDomain The email domain to look up
     * @return wallet Address of the institution
     */
    function getInstitutionByDomain(
        string calldata emailDomain
    ) external view returns (address wallet) {
        return emailDomainToAddress[emailDomain];
    }

    /**
     * @notice Get current contract version
     * @return Current version string
     */
    function getVersion() public pure virtual returns (string memory) {
        return VERSION;
    }

    /**
     * @notice Get complete upgrade history
     * @return Array of all UpgradeInfo structs
     */
    function getUpgradeHistory() external view returns (UpgradeInfo[] memory) {
        return upgradeHistory;
    }

    /**
     * @notice Record a contract upgrade
     * @param newVersion Version string for the upgrade (e.g., "2.0.0")
     * @param notes Description of changes in this upgrade
     * @dev Only callable by super admin. Should be called after upgrading the contract.
     */
    function recordUpgrade(
        string calldata newVersion,
        string calldata notes
    ) external onlyRole(SUPER_ADMIN_ROLE) {
        upgradeHistory.push(UpgradeInfo({
            version: newVersion,
            timestamp: block.timestamp,
            upgrader: msg.sender,
            notes: notes
        }));
    }

    /**
     * @dev Storage gap for future upgrades
     * Reserves 47 slots for adding new state variables without breaking storage layout
     * If adding new variables, reduce this number accordingly (50 - added slots)
     */
    uint256[47] private __gap;

    /**
     * @notice Authorize contract upgrade
     * @param newImplementation Address of the new implementation
     * @dev Only callable by super admin
     */
    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyRole(SUPER_ADMIN_ROLE) {}

    /**
     * @notice Grant CERTIFICATE_REGISTRY_ROLE to an address
     * @param certificateRegistry Address of the CertificateRegistry contract
     * @dev Only callable by super admin
     */
    function setCertificateRegistry(
        address certificateRegistry
    ) external onlyRole(SUPER_ADMIN_ROLE) {
        if (certificateRegistry == address(0)) revert InvalidAddress();
        _grantRole(CERTIFICATE_REGISTRY_ROLE, certificateRegistry);
    }
}

