// SPDX-License-Identifier: MIT
pragma solidity 0.8.24;

/**
 * @title ICertificateRegistry
 * @notice Interface for the Certificate Registry contract
 * @dev Defines the external functions for certificate management
 */
interface ICertificateRegistry {
    /// @notice Certificate data structure
    struct Certificate {
        bytes32 documentHash;
        address studentWallet;
        address issuingInstitution;
        uint256 issueDate;
        uint256 certificateId;
        string metadataURI;
        bool isRevoked;
        uint256 revokedAt;
        string revocationReason;
    }

    /// @notice Emitted when a new certificate is issued
    event CertificateIssued(
        uint256 indexed certificateId,
        bytes32 indexed documentHash,
        address indexed studentWallet,
        address issuingInstitution,
        uint256 issueDate
    );

    /// @notice Emitted when a certificate is revoked
    event CertificateRevoked(
        uint256 indexed certificateId,
        address indexed revokedBy,
        string reason,
        uint256 timestamp
    );

    /// @notice Issue a new certificate
    /// @param documentHash SHA-256 hash of the PDF document
    /// @param studentWallet Wallet address of the student
    /// @param metadataURI Optional IPFS/Arweave URI for additional metadata
    /// @return certificateId The unique ID of the issued certificate
    function issueCertificate(
        bytes32 documentHash,
        address studentWallet,
        string calldata metadataURI
    ) external returns (uint256 certificateId);

    /// @notice Revoke a certificate
    /// @param certificateId The ID of the certificate to revoke
    /// @param reason The reason for revocation
    function revokeCertificate(
        uint256 certificateId,
        string calldata reason
    ) external;

    /// @notice Get certificate by ID
    /// @param certificateId The ID of the certificate
    /// @return Certificate struct with all details
    function getCertificate(
        uint256 certificateId
    ) external view returns (Certificate memory);

    /// @notice Get certificate by document hash
    /// @param documentHash The SHA-256 hash of the document
    /// @return Certificate struct with all details
    function getCertificateByHash(
        bytes32 documentHash
    ) external view returns (Certificate memory);

    /// @notice Get all certificate IDs for a student
    /// @param studentWallet The wallet address of the student
    /// @return Array of certificate IDs
    function getCertificatesByStudent(
        address studentWallet
    ) external view returns (uint256[] memory);

    /// @notice Verify if a certificate is valid
    /// @param documentHash The SHA-256 hash of the document
    /// @return isValid True if the certificate exists and is not revoked
    /// @return certificateId The ID of the certificate (0 if not found)
    /// @return isRevoked True if the certificate has been revoked
    function isValidCertificate(
        bytes32 documentHash
    ) external view returns (bool isValid, uint256 certificateId, bool isRevoked);

    /// @notice Get total number of certificates issued
    /// @return The total count
    function getTotalCertificates() external view returns (uint256);
}

contracts/interfaces/IInstitutionRegistr.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.24;

/**
 * @title IInstitutionRegistry
 * @notice Interface for the Institution Registry contract
 * @dev Defines the external functions for institution management
 */
interface IInstitutionRegistry {
    /// @notice Institution data structure
    struct Institution {
        string name;
        string emailDomain;
        address walletAddress;
        bool isVerified;
        bool isActive;
        uint256 verificationDate;
        uint256 totalCertificatesIssued;
    }

    /// @notice Emitted when a new institution registers
    event InstitutionRegistered(
        address indexed wallet,
        string name,
        string emailDomain
    );

    /// @notice Emitted when an institution is approved by super admin
    event InstitutionApproved(address indexed wallet, uint256 timestamp);

    /// @notice Emitted when an institution is suspended
    event InstitutionSuspended(address indexed wallet, uint256 timestamp);

    /// @notice Emitted when an institution is reactivated
    event InstitutionReactivated(address indexed wallet, uint256 timestamp);

    /// @notice Check if an institution can issue certificates
    /// @param wallet The wallet address of the institution
    /// @return bool True if the institution is verified and active
    function canIssueCertificates(address wallet) external view returns (bool);

    /// @notice Increment the certificate count for an institution
    /// @param wallet The wallet address of the institution
    function incrementCertificateCount(address wallet) external;

    /// @notice Get institution details
    /// @param wallet The wallet address of the institution
    /// @return Institution struct with all details
    function getInstitution(address wallet) external view returns (Institution memory);

    /// @notice Get all registered institution addresses
    /// @return Array of institution wallet addresses
    function getAllInstitutions() external view returns (address[] memory);

    /// @notice Get the total number of registered institutions
    /// @return The count of institutions
    function getInstitutionCount() external view returns (uint256);
}

